import { Avatar, TextField } from '@material-ui/core';
import React from 'react';
import nikklaus from './nikklaus.jpg'
const Posts = () => {
    return (
        <div>     
           
           <Avatar style={{height:'60px',width:'60px'}} alt="Remy Sharp" src={nikklaus}  /> 
              <TextField style={{paddingLeft:'100px', width:'500px' }}
              
          id="filled-textarea"
          label="What's on your mind dawg?"
          placeholder="Placeholder"
          multiline
          variant="filled"
        ></TextField>
        </div>
     );
}
 
export default Posts;
